import "./catalog.css";
import Product from "./product";

const Catalog = () => {
  return (
    <div className="catalog">
      <h2>View Our Products</h2>
      <div className="productList"><Product></Product>
      <Product></Product>
      <Product></Product>
      <Product></Product></div>
    </div>
  );
};

export default Catalog;
